// Importe 'boxicons/css/boxicons.min.css' e outras dependências

import { BrowserRouter, Routes, Route, MemoryRouter } from 'react-router-dom';
import AppLayout from './components/layout/AppLayout';
import Blank from './pages/Blank';
import MenuRoutes from './caminho/do/seu/arquivo/de/rotas/do/menu';

function RoutesDashboard() {
    return (
        <BrowserRouter>
            <Routes>
                <Route
                    path='/'
                    element={
                        <AppLayout>
                            <Route index element={<Blank />} />
                            <Route path='/started' element={<Blank />} />
                            <Route path='/calendar' element={<Blank />} />
                            <Route path='/user' element={<Blank />} />
                            <Route path='/order' element={<Blank />} />
                        </AppLayout>
                    }
                />
            </Routes>
        </BrowserRouter>
    );
}

// Exporte o MemoryRouter para as rotas do menu
export default function App() {
    return (
        <MemoryRouter>
            <MenuRoutes />
        </MemoryRouter>
    );
}
